import React from "react";

function Jumbotron(){

    return(
        <div>
            <div class="jumbotron jumbotron-fluid">
                <div class="container">
                <h4 class="display-4 text-white text-center">Ethan Wang-So</h4>
                <br></br>
                <p class="display-5 text-white text-center">Programmer and Computer Science Student</p>
                </div>
            </div>
        </div>

    );
}

export default Jumbotron;
